import React from 'react';

import './App.css';
import HomeScreen from './HomeScreen';

import {
  BrowserRouter as Router,
  Switch,
  Route,
} from "react-router-dom";
 

function App() {
  return (
    <div className="app">
     
      <HomeScreen />
       <Router>
    
        <nav>
          <ul>
            <li>
              <Link to="/">Home</Link>
            </li>
            <li>
              <Link to="/about">About</Link>
            </li>
            <li>
              <Link to="/users">Users</Link>
            </li>
          </ul>
        </nav>

       
    </Router>


    </div>
  );
}

export default App;
